import React from 'react'

export default function Card(props){
    let badgeText
    if (props.obj.openSpots === 0) {
        badgeText = "SOLD OUT"
    } else if (props.obj.location === "Online") {
        badgeText = "ONLINE"
    } else if(props.obj.openSpots>0){
        badgeText="AVAILABLE"
    }
return(
    <div className="card">
        <img src= {`./${props.obj.coverImg}`} className="card-photo"/>
        { badgeText &&<button className="btn">{badgeText}</button> }
        <p className="star-items"> 
            <img src="./Star.png" className="star-photo"/>   
        {props.obj.stats.rating}
        <code>({props.obj.stats.reviewCount})</code>
        . {props.obj.location}</p>
        <p>{props.obj.title}</p>
        <p><b>From ${props.obj.price}</b>/per person</p>
    </div>
    );
}
